<span class="line"><span style="--shiki-light:#6F42C1;--shiki-dark:#B392F0;">tm_uuidv5(</span><span style="--shiki-light:#6F42C1;--shiki-dark:#B392F0;">&quot;x500&quot;</span><span style="--shiki-light:#6F42C1;--shiki-dark:#B392F0;">,</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> &quot;CN=Example,C=GB&quot;</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">)</span></span>
